import { ThemeProvider } from "styled-components";
import { useState, useEffect } from "react";
import { darkTheme, lightTheme } from './utils/Themes.js'
import Navbar from "./components/Navbar";
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  // Import Routes and Route
import HeroSection from "./components/HeroSection";
import About from "./components/About";
import Skills from "./components/Skills";
import Projects from "./components/Projects";
import Contact from "./components/Contact";
import Footer from "./components/Footer";
import Experience from "./components/Experience";
import Education from "./components/Education";
import ProjectDetails from "./components/ProjectDetails";
import styled from "styled-components";

const Body = styled.div`
  background-color: ${({ theme }) => theme.bg};
  width: 100%;
  overflow-x: hidden;
`;

const Wrapper = styled.div`
  background: linear-gradient(38.73deg, rgba(204, 0, 187, 0.15) 0%, rgba(201, 32, 184, 0) 50%), linear-gradient(141.27deg, rgba(0, 70, 209, 0) 50%, rgba(0, 70, 209, 0.15) 100%);
  width: 100%;
  clip-path: polygon(0 0, 100% 0, 100% 100%,30% 98%, 0 100%);
`;

function App() {
  const [darkMode, setDarkMode] = useState(true);
  const [openModal, setOpenModal] = useState({ state: false, project: null });

  console.log(openModal); // Keep this to debug modal state, remove later if unnecessary

  return (
    <ThemeProvider theme={darkMode ? darkTheme : lightTheme}>
      <Router>
        <Navbar />
        <Body>
          {/* Define Routes for each section */}
          <Routes>
            <Route path="/" element={<HeroSection />} />
            <Route path="/#about" element={<About />} />
            <Route path="/#skills" element={<Skills />} />
            <Route path="/#experience" element={<Experience />} />
            <Route path="/#projects" element={<Projects openModal={openModal} setOpenModal={setOpenModal} />} />
            <Route path="/#education" element={<Education />} />
            <Route path="/#contact" element={<Contact />} />
          </Routes>

          <Wrapper>
            <Skills />
            <Experience />
          </Wrapper>

          <Wrapper>
            <Education />
            <Contact />
          </Wrapper>

          <Footer />

          {/* Conditionally render ProjectDetails modal */}
          {openModal.state && 
            <ProjectDetails openModal={openModal} setOpenModal={setOpenModal} />
          }
        </Body>
      </Router>
    </ThemeProvider>
  );
}

export default App;
